        <a className='project' href='https://protected-hamlet-00069.herokuapp.com/' rel='noopener noreferrer' target='_blank'>2nd Group Project: Pokedex-Project<img src={SecondGrpProject}  alt='pokedex-project'/></a>
    </main>
  )
}
export default Project;
